sys_variable_value.value:
(function execute(inputs, outputs) {
    var pubSub = new GooglePubsubUtils();
    pubSub.validateInputVariables(inputs, outputs);
    pubSub.validateMandatoryVariables(inputs, ["projectid", "name"]);
    pubSub.maptoOutputFromInput(inputs, outputs, ["projectid", "name"]);
    var payload = {
        "policy": {
            "bindings": []
        }
    }
    inputs.bindings.forEach(function(binding) {
        if (binding.role.trim() && binding.members.length > 0) {
            var bindingObject = {}
            bindingObject["role"] = binding.role.trim();
            bindingObject["members"] = pubSub.newArrayObject(binding.members);
            var conditions = binding.condition;
            if (conditions.title.trim() && conditions.description.trim() && conditions.expression.trim()) {
                bindingObject["condition"] = {
                    "title": conditions.title.trim(),
                    "description": conditions.description.trim(),
                    "expression": conditions.expression.trim()

                }
            }
            payload["policy"]["bindings"] = bindingObject;
        }
        if (payload["policy"]["bindings"].length < 0)
            throw new Error("Atleast one binding is required");
        outputs.payload = JSON.stringify(payload);
    });
})(inputs, outputs);

